/* ==UserStyle==
@name           github.com - Feb 2024
@namespace      github.com/openstyles/stylus
@version        1.0.0
@description    A new userstyle
@author         Me
==/UserStyle== */
@-moz-document domain("github.com") {
    /* Insert code here... */
    #header {
        font-size: 14px !important;
    }
    pre,
    code,
    kbd,
    .blob-num,
    .blob-code,
    .blob-code-marker,
    .react-code-text,
    .text-mono,
    .react-blob-print-hide,
    .diff-table,
    .blob-code-inner {
        font-family: 'Operator Mono Lig' !important;
/*         font-size: 14px !important; */
    }
}

sections.code:
code, pre {
    font-family: 'Operator Mono Lig Book' !important;
}
